import React from "react";
import App from "./App";
import Charts from "./Charts";
import { Route, Link } from "react-router-dom";

function Routes() {
    return (
        <div>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/Charts">Charts</Link>
                </li>
            </ul>
            <Routes>
                <Route exact path="/" element={<App />}></Route>
                <Route exact path="/" element={<Charts />}></Route>
                {/* <Route exact path="/charts" elementcomponent={Charts}></Route> */}
            </Routes>
        </div>
    );
}

export default Routes;
